const LoginSuccess = () => {
  return (
    <div className="login-success-container">
      <div className="login-success-card">
        <h1>Success!</h1>
        <p>You have successfully logged in.</p>
        <p>Click to go back to login page 
          <Link to="/" style={{textDecoration: "none", color:"white" }}> Click Me !!!</Link>
        </p>
      </div>
    </div>
  );
}

export default LoginSuccess;
